import React from 'react';
import { Route, Switch, useLocation } from 'react-router-dom';
import { CSSTransition, TransitionGroup } from 'react-transition-group';
import SetTemplate from 'templates/SetTemplate';
import { Sets } from 'data/Sets';
import 'animation/transition.css';

function SetsView() {
  return (
    <Route
      render={({ location }) => (
        <TransitionGroup>
          <Switch>
            <CSSTransition key={location.key} timeout={10000} classNames="item">
              <Route exact path="/F">
                <SetTemplate Sets={Sets[0]} />
              </Route>
            </CSSTransition>
            <CSSTransition key={location.key} timeout={10000} classNames="item">
              <Route exact path="/P">
                <SetTemplate Sets={Sets[1]} />
              </Route>
            </CSSTransition>
          </Switch>
        </TransitionGroup>
      )}
    />
  );
}

export default SetsView;
